Главная / Новости / Китайский бизнес инвестирует почти 1 млрд долларов в сельское хозяйство Казахстана Китайский бизнес инвестирует почти 1 млрд долларов в сельское хозяйство Казахстана 7 ноября 2017, вторник, 15:36 Новости 232 В ходе визита заместителя премьер-министра – министра сельского хозяйства Аскара Мырзахметова в Китай подписан ряд соглашений о сотрудничестве и торговле в агропромышленном комплексе 
В частности, как сообщила пресс-служба Минсельхоза Казахстана, между национальным управляющим холдингом «КазАгро» и китайской State Development and Investment Corporation подписан меморандум по строительству агроиндустриального комплекса в Южно-Казахстанской области стоимостью от 100 миллионов долларов. 

Также между «КазАгро» и Grand China Business Management Co. LTD подписан меморандум по строительству фермы по производству пшеницы премиум-класса стоимостью от 100 миллионов долларов. АО «Продкорпорация» и Dalian Commodity Exchange заключили меморандум по строительству сети оптово-распределительных центров и организации товарной биржи. 

Есть и новые соглашения об экспорте продукции. Продкорпорация и Grand China Business Management Co. LTD. достигли договоренности об экспорте 20 тысяч тонн казахстанской пшеницы первого класса (сумма контракта 4,5 миллиона долларов). А между АО «Продкорпорация» и Grand China Business Management Co. LTD. подписано соглашение об экспорте 2000 тонн растительного масла (1,5 миллиона долларов). 

Кроме того, между мясным союзом Казахстана и CITIC Construction заключен меморандум по реализации инвестиционной программы на 2018-2024 годы по строительству инфраструктуры для производства и экспорта живых коров и говядины. Стоимость проекта составляет 600 миллионов долларов. 

Отметим, что в последние годы Казахстан активно продвигает свою сельскохозяйственную продукцию на рынки Китая. Помимо традиционного экспорта пшеницы, республика планирует экспортировать в Китай растительное масло, кукурузу, мясо и фуражное зерно. Соответствующие контракты уже подписаны – преимущественно с Продкорпорацией, получившей статус экспортного центра АПК. 

"На встрече в Китае между РК и главным управлением надзора за качеством, инспекции и карантина КНР был подписан протокол по требованиям карантина и охраны здоровья, предъявляемым к лошадям, экспортируемым для убоя из Казахстана в Китай", – сообщили в министерстве. 

Также участники встречи подписали соглашения между казахстанскими и китайскими компаниями о сотрудничестве в торговле и привлечении инвестиций в АПК: 

- между АО "НУХ КАЗАГРО" и State Development and Investment Corporation подписан меморандум о строительстве агроиндустриального комплекса в ЮКО стоимостью от 100 млн долларов; 
- между АО "НУХ КАЗАГРО" и Grand China Business Management Co. LTD подписан меморандум о строительстве фермы по производству пшеницы премиум-класса стоимостью от 100 млн долларов; 

- между АО "Продкорпорация" и Dalian Commodity Exchange подписан меморандум о строительстве сети оптово-распределительных центров и организации товарной биржи; 
- между АО "Продкорпорация" и Grand China Business Management Co. LTD. достигнуты договорённости об экспорте 20 тысяч тонн пшеницы первого класса на сумму 4,5 млн долларов; 
- между АО "Продкорпорация" и Grand China Business Management Co. LTD. подписано соглашение об экспорта 2 тысяч тонн растительного масла на 1,5 млн долларов; 
- между ОЮЛ "Мясной союз Казахстана" и CITIC Construction подписан меморандум о реализации инвестиционной программы на 2018-2024 годы по строительству инфраструктуры для производства и экспорта живых коров и говядины на 600 млн долларов. 
Летом этого года Китай на свои средства открыл в Казахстане ветлабораторию, чтобы наладить экспорт сельхозпродукции в Китай. 

Без лаборатории соответствующего уровня нельзя было экспортировать мясо в Китай, так как не было возможности сертифицировать отечественную продукцию в соответствии с требованиями китайских закупщиков.
